import React from 'react';

class Slide extends React.Component{
  render() {
    return (
      <div className="slide-content py-auto mt-2">
        <div className="user-image">
          <img src={this.props.imgsrc} alt="" className="user-photo rounded-circle" />
        </div>
        <h3>{this.props.userName}</h3>
        <p>{this.props.text}</p>
      </div>
    )
  }
}
export default Slide;
